import React from 'react';
import styled from 'styled-components';
import ProfileAside from './ProfileAside';
import ProfileLevel3 from './ProfileLevel3';

function ProfilePage() {
	return (
		<ComponentWrapper>
			<nav className="profile-title">
				<h2>
					<p>프로필</p>
				</h2>
			</nav>
			<div className="machup">
				<ProfileAside />
				<section></section>
			</div>
			<ProfileLevel3 />
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	> section {
		padding-left: 270px;
	}
	.career-connection {
	}
	.machup {
		margin: 0 auto;
		max-width: 1060px;
		position: relative;
	}
	.profile-title {
		position: relative;
		line-height: normal;
		p {
			font-size: 20px;
			font-weight: 700;
			color: #333;
			padding: 50px 0 20px;
		}
	}
`;

export default ProfilePage;
